svg.script:

// Progressive enhancement for interactive functionality
if (typeof window !== 'undefined') {
  const principleNodes = document.querySelectorAll('.principle-node');

  principleNodes.forEach(node => {
    node.addEventListener('click', function() {
      const principleId = this.id;
      // Trigger navigation to principle chapter
      if (window.frameworkNavigation) {
        window.frameworkNavigation.navigateToPrinciple(principleId);
      }
    });

    node.addEventListener('keydown', function(e) {
      if (e.key === 'Enter' || e.key === ' ') {
        e.preventDefault();
        this.click();
      }
    });
  });

  // Track interactions for analytics
  document.addEventListener('click', function(e) {
    if (e.target.closest('.principle-node')) {
      const principle = e.target.closest('.principle-node').id;
      if (window.analytics) {
        window.analytics.track('principle_hub_interaction', { principle });
      }
    }
  });
}
